ster","listCacheKey":"v0:1700499641.0","canEdit":false,"refType":"branch","currentOid":"564d0252ca632e0264ed670534a51d18a689ef5d"},"path":"contrib/completion/git-completion.bash","currentUser":null,"blob":{"rawLines":["# bash/zsh completion support for core Git.","#","# Copyright (C) 2006,2007 Shawn O. Pearce <spearce@spearce.org>","# Conceptually based on gitcompletion (http://gitweb.hawaga.org.uk/).","# Distributed under the GNU General Public License, version 2.0.","#","# The contained completion routines provide support for completing:","#","#    *) local and remote branch names","#    *) local and remote tag names","#    *) .git/remotes file names","#    *) git 'subcommands'","#    *) git email aliases for git-send-email","#    *) tree paths within 'ref:path/to/file' expressions","#    *) file paths within current working directory and index","#    *) common --long-options","#","# To use these routines:","#","#    1) Copy this file to somewhere (e.g. ~/.git-completion.bash).","#    2) Add the following line to your .bashrc/.zshrc:","#        source ~/.git-completion.bash","#    3) Consider changing your PS1 to also show the current branch,","#       see git-prompt.sh for details.","#","# If you use complex aliases of form '!f() { ... }; f', you can use the null","# command ':' as the first command in the function body to declare the desired","# completion style.  For example '!f() { : git commit ; ... }; f' will","# tell the completion to use commit completion.  This also works with aliases","# of form \"!sh -c '...'\".  For example, \"!sh -c ': git commit ; ... '\".","# Note that \"git\" is optional --- '!f() { : commit; ...}; f' would complete","# just like the 'git commit' command.","#","# If you have a command that is not part of git, but you would still","# like completion, you can use __git_complete:","#","#   __git_complete gl git_log","#","# Or if it's a main command (i.e. git or gitk):","#","#   __git_complete gk gitk","#","# Compatible with bash 3.2.57.","#","# You can set the following environment variables to influence the behavior of","# the completion routines:","#","#   GIT_COMPLETION_CHECKOUT_NO_GUESS","#","#     When set to \"1\", do not include \"DWIM\" suggestions in git-checkout","#     and git-switch completion (e.g., completing \"foo\" when \"origin/foo\"","#     exists).","#","#   GIT_COMPLETION_SHOW_ALL_COMMANDS","#","#     When set to \"1\" suggest all commands, including plumbing commands","#     which are hidden by default (e.g. \"cat-file\" on \"git ca<TAB>\").","#","#   GIT_COMPLETION_SHOW_ALL","#","#     When set to \"1\" suggest all options, including options which are","#     typically hidden (e.g. '--allow-empty' for 'git commit').","#","#   GIT_COMPLETION_IGNORE_CASE","#","#     When set, uses for-each-ref '--ignore-case' to find refs that match","#     case insensitively, even on systems with case sensitive file systems","#     (e.g., completing tag name \"FOO\" on \"git checkout f<TAB>\").","","case \"$COMP_WORDBREAKS\" in","*:*) : great ;;","*)   COMP_WORDBREAKS=\"$COMP_WORDBREAKS:\"","esac","","# Discovers the path to the git repository taking any '--git-dir=<path>' and","# '-C <path>' options into account and stores it in the $__git_repo_path","# variable.","__git_find_repo_path ()","{","\tif [ -n \"${__git_repo_path-}\" ]; then","\t\t# we already know where it is","\t\treturn","\tfi","","\tif [ -n \"${__git_C_args-}\" ]; then","\t\t__git_repo_path=\"$(git \"${__git_C_args[@]}\" \\","\t\t\t${__git_dir:+--git-dir=\"$__git_dir\"} \\","\t\t\trev-parse --absolute-git-dir 2>/dev/null)\"","\telif [ -n \"${__git_dir-}\" ]; then","\t\ttest -d \"$__git_dir\" &&","\t\t__git_repo_path=\"$__git_dir\"","\telif [ -n \"${GIT_DIR-}\" ]; then","\t\ttest -d \"$GIT_DIR\" &&","\t\t__git_repo_path=\"$GIT_DIR\"","\telif [ -d .git ]; then","\t\t__git_repo_path=.git","\telse","\t\t__git_repo_path=\"$(git rev-parse --git-dir 2>/dev/null)\"","\tfi","}","","# Deprecated: use __git_find_repo_path() and $__git_repo_path instead","# __gitdir accepts 0 or 1 arguments (i.e., location)","# returns location of .git repo","__gitdir ()","{","\tif [ -z \"${1-}\" ]; then","\t\t__git_find_repo_path || return 1","\t\techo \"$__git_repo_path\"","\telif [ -d \"$1/.git\" ]; then","\t\techo \"$1/.git\"","\telse","\t\techo \"$1\"","\tfi","}","","# Runs git with all the options given as argument, respecting any","# '--git-dir=<path>' and '-C <path>' options present on the command line","__git ()","{","\tgit ${__git_C_args:+\"${__git_C_args[@]}\"} \\","\t\t${__git_dir:+--git-dir=\"$__git_dir\"} \"$@\" 2>/dev/null","}","","# Removes backslash escaping, single quotes and double quotes from a word,","# stores the result in the variable $dequoted_word.","# 1: The word to dequote.","__git_dequote ()","{","\tlocal rest=\"$1\" len ch","","\tdequoted_word=\"\"","","\twhile test -n \"$rest\"; do","\t\tlen=${#dequoted_word}","\t\tdequoted_word=\"$dequoted_word${rest%%[\\\\\\'\\\"]*}\"","\t\trest=\"${rest:$((${#dequoted_word}-$len))}\"","","\t\tcase \"${rest:0:1}\" in","\t\t\\\\)","\t\t\tch=\"${rest:1:1}\"","\t\t\tcase \"$ch\" in","\t\t\t$'\\n')","\t\t\t\t;;","\t\t\t*)","\t\t\t\tdequoted_word=\"$dequoted_word$ch\"","\t\t\t\t;;","\t\t\tesac","\t\t\trest=\"${rest:2}\"","\t\t\t;;","\t\t\\')","\t\t\trest=\"${rest:1}\"","\t\t\tlen=${#dequoted_word}","\t\t\tdequoted_word=\"$dequoted_word${rest%%\\'*}\"","\t\t\trest=\"${rest:$((${#dequoted_word}-$len+1))}\"","\t\t\t;;","\t\t\\\")","\t\t\trest=\"${rest:1}\"","\t\t\twhile test -n \"$rest\" ; do","\t\t\t\tlen=${#dequoted_word}","\t\t\t\tdequoted_word=\"$dequoted_word${rest%%[\\\\\\\"]*}\"","\t\t\t\trest=\"${rest:$((${#dequoted_word}-$len))}\"","\t\t\t\tcase \"${rest:0:1}\" in","\t\t\t\t\\\\)","\t\t\t\t\tch=\"${rest:1:1}\"","\t\t\t\t\tcase \"$ch\" in","\t\t\t\t\t\\\"|\\\\|\\$|\\`)","\t\t\t\t\t\tdequoted_word=\"$dequoted_word$ch\"","\t\t\t\t\t\t;;","\t\t\t\t\t$'\\n')","\t\t\t\t\t\t;;","\t\t\t\t\t*)","\t\t\t\t\t\tdequoted_word=\"$dequoted_word\\\\$ch\"","\t\t\t\t\